package com.java.basics;

public class StringExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String name = "Munish";
		System.out.println("Name:" + name);
		name = "Munish Prabhu Paramanantham";
		System.out.println("Name:" + name);
		name = "Munish";
		System.out.println("Name:" + name);
	}

}
